// SPDX-License-Identifier: MIT
// Market Place
pragma solidity ^0.8.0;

import './INERC721A.sol';
import './Struct.sol';
import './Logger.sol';
import '@openzeppelin/contracts/access/Ownable.sol';

contract MarketPlace is Ownable, Struct {
    
    List[] _lists;

    address addressLoger;

    constructor(address _addressLoger){
        addressLoger = _addressLoger;
    }

    modifier onlyExistingListing(uint256 _listingId) {
        require(_lists[_listingId].addressContractToken != address(0), "listing DNE");
        _;
    }

    function unsafe_inc(uint256 x) private pure returns (uint256){
        unchecked { return x + 1;}
    }

    /**
    French - On vérifie que l'ensemble des pourcentage des bénificaires est inférieur ou égual a 100
    English - We check that the total percentage of beneficiaries is less than or equal to 100
     */
    function checkRoyalties(address[] memory _royaltiesAddr,uint8[] memory _royaltiesPercent) pure internal {
        uint8 percentTotal = 0;
        for (uint256 index = 0; index < _royaltiesAddr.length; index= unsafe_inc(index)) {
            percentTotal+=_royaltiesPercent[index];
        }
        require(percentTotal<=100,"% royalties > 100");
    }

    /**
    French
    1 - On vérifie que la longueur du tableau de prix de token est aussi long que le tableau d'id token
    2 - On vérifie que les deux précédents tableau sont > 0
    3 - On vérifie que la longueur des tableau d'addresse de royalties et de pourcentages correspondent 
    English
    1 - We check that the length of the token price array is as long as the token id array
    2 - We check that the length of the two previous tables are > 0
    3 - We check that the length of the address table of royalties and percentages correspond 
    */
    function validList(List memory paramsList) internal pure {
        require(/*INERC721A(paramsList.addressContractToken).owner()==msg.sender
        &&
        */paramsList._tokenInAuction.length==paramsList._priceToken.length&&paramsList._tokenInAuction.length>0&&paramsList._priceToken.length>0
        &&
        paramsList._royaltiesAddr.length==paramsList._royaltiesPercent.length,
        "Incorrect list");
    }

    function createList(List memory paramsList) external onlyOwner returns(uint256) {
        validList(paramsList);
        checkRoyalties(paramsList._royaltiesAddr,paramsList._royaltiesPercent);
        List memory newListing = List({
            lastBidder: Bidder(address(0),0),
            addressContractToken: paramsList.addressContractToken,
            addressMinter: paramsList.addressMinter,
            paused: paramsList.paused,
            _royaltiesAddr: paramsList._royaltiesAddr,
            _royaltiesPercent: paramsList._royaltiesPercent,
            _tokenInAuction: paramsList._tokenInAuction,
            _priceToken: paramsList._priceToken,
            listingId: _lists.length,
            minBid: paramsList.minBid,
            startDate: paramsList.startDate,
            timeAuction: paramsList.timeAuction,
            direct: paramsList.direct,
            tokenType: paramsList.tokenType
        });
        Logger(addressLoger)._Lists(address(this),_lists.length,msg.sender, newListing,"Create");
        _lists.push(newListing);
        return _lists.length-1;
    }

    function updateList(List memory paramsList) external onlyOwner returns(List memory) {
        validList(paramsList);
        checkRoyalties(paramsList._royaltiesAddr,paramsList._royaltiesPercent);

        if (_lists[paramsList.listingId].direct == false) {
            require(block.timestamp < _lists[paramsList.listingId].startDate || _lists[paramsList.listingId].startDate == 0, "Auction started.");
        }

        _lists[paramsList.listingId] = List({
            lastBidder: _lists[paramsList.listingId].lastBidder,
            addressContractToken: paramsList.addressContractToken,
            addressMinter: paramsList.addressMinter,
            paused: paramsList.paused,
            _royaltiesAddr: paramsList._royaltiesAddr,
            _royaltiesPercent: paramsList._royaltiesPercent,
            _tokenInAuction: paramsList._tokenInAuction,
            _priceToken: paramsList._priceToken,
            listingId: paramsList.listingId,
            minBid: paramsList.minBid,
            startDate: paramsList.startDate,
            timeAuction: paramsList.timeAuction,
            direct: paramsList.direct,
            tokenType: paramsList.tokenType
        });
        Logger(addressLoger)._Lists(address(this),paramsList.listingId,msg.sender, _lists[paramsList.listingId],"Update");
        return _lists[paramsList.listingId];
    }
    
    /**
    French
    1 - vérifie que l'ont a envoyé autant ou plus d'eth que le prix du token dans la list
    2 - vérifie que le token id correspond a l'élement de la clé "tokenNumber"
    3 - suppression du token dans tout les cas car même si il n'éxiste pas il doit être supprimé
    4 - si lazy mint, on vérifie qu'il existe avant de le minté sinon require, donc rembourssé
    5 - si batch mint on vérifie que l'addressminter possède toujours le tokensinon require, donc rembourssé, sinon on transfert vers l'acheteur
    6 - si le tableau de token est vide, on supprime la list (optimisation)
    English
    1 - check that we have sent as much or more eth than the price of the token in the list
    2 - check that the token id matches the element of the key "tokenNumber"
    3 - deletion of the token in any case because even if it does not exist it must be deleted
    4 - if lazy mint, we check that it exists before minting it otherwise require, so refunded
    5 - if batch mint we check that the addressminter still has the tokensinon require, so refunded, otherwise we transfer to the buyer
    6 - if the token array is empty, we delete the list (optimization)
     */
    function buy(uint256 _listingId, uint256 tokenNumber, uint256 tokenId) external payable onlyExistingListing(_listingId) {
        require(msg.value >= _lists[_listingId]._priceToken[tokenNumber],"Not enought money");
        require(_lists[_listingId]._tokenInAuction[tokenNumber] == tokenId,"Not good id");
        
        INERC721A contractToken = INERC721A(_lists[_listingId].addressContractToken);
        
        for (uint256 i = tokenNumber; i < _lists[_listingId]._tokenInAuction.length - 1; i= unsafe_inc(i)) {
            _lists[_listingId]._tokenInAuction[i] = _lists[_listingId]._tokenInAuction[i+1];
            _lists[_listingId]._priceToken[i] = _lists[_listingId]._priceToken[i+1];
        }
        _lists[_listingId]._tokenInAuction.pop();
        _lists[_listingId]._priceToken.pop();

        if(contractToken.getLazyMint()==true){
            require(contractToken.exists(tokenId) == true,"Token minted");
            contractToken.lazyMint(1,msg.sender,tokenId);
        }else{
            require(_lists[_listingId].addressMinter == contractToken.ownerOf(tokenId),"Token not owned");
            contractToken.safeTransferFrom(_lists[_listingId].addressMinter, msg.sender, tokenId, "");
        }
        
        payRoyalties(_listingId,msg.value);
        Logger(addressLoger)._Buy(address(this),msg.sender,msg.value,tokenId,_listingId);
        if(_lists[_listingId]._tokenInAuction.length<=0){
            Logger(addressLoger)._Lists(address(this),_listingId,msg.sender, _lists[_listingId],"All selled");
            deleteList(_listingId);
        } 
    }

    /**
    French - Annule une liste seulement avant qu'elle soit démarer ou si c'est une vente direct
    English - Cancel a listing only before it is started or if it is a direct sale
    */
    function cancelList(uint256 _listingId) external onlyOwner {
        require(block.timestamp < _lists[_listingId].startDate || _lists[_listingId].startDate == 0 || _lists[_listingId].direct == true, "Auction started.");
        Logger(addressLoger)._Lists(address(this),_listingId,msg.sender, _lists[_listingId],"Cancel");
        deleteList(_listingId);
    }

    /**
    French - Supprime une liste a la fin d'une enchère, après avoir vendu tout les tokens d'une vente direct, ou bien a l'annulation d'une list tout en gardant l'ordre des lists
    English - Delete a list at the end of an auction, after having sold all the tokens of a direct sale, or at the cancellation of a list while keeping the order of the lists
    */
    function deleteList(uint256 _listingId) internal {
        for (uint256 i = _listingId; i < _lists.length - 1; i= unsafe_inc(i)) {
            _lists[i] = _lists[i+1];
        }
        _lists.pop();
    }

    /**
    French - Récupère un objet d'une List contenu sur le market place contract
    English - Retrieve an object from a List contained in the market place contract
    */
    function getList(uint256 _listingId) external view returns (List memory){
        return _lists[_listingId];
    }

    /**
    French - Récupère un tableau d'objets des List contenu sur le market place contract
    English - Get an array of List objects contained in the market place contract
    */
    function getLists() external view returns (List[] memory){
        List[] memory result = new List[](_lists.length);
        for(uint256 i = 0; i < _lists.length; i= unsafe_inc(i)){
            List storage _list = _lists[i];
            result[i] = _list;
        }
        return result;
    }

    /**
    French - Boucle sur le tableau de token de la list et envoi chacun des tokens vers la _to addresse
    English - Loop over the token array of the list and send each token to the _to address
     */
    function transferListingTokens(address _from, address _to, List memory _listing ) internal {
        if (_listing.tokenType == 1) {
            //INERC1155(_listing.assetContract).safeTransferFrom(_from, _to, _listing.tokenId, _quantity);
        } else if (_listing.tokenType == 2) {
            IERC721 contractToken = IERC721(_listing.addressContractToken);
            for (uint256 index = 0; index < _listing._tokenInAuction.length; index= unsafe_inc(index)) {
                contractToken.safeTransferFrom(_from, _to, _listing._tokenInAuction[index], "");
            }
        }
    }

