    /**
    French
    1 - Vérifier que l'enchérisseur a envoyé plus d'ETH que la demande inital ou que le dernier enchérisseur
    2 - Cérifier que l'enchère à démarrer et n'est pas fini
    3 - Rembourssé le précendent écherisseur de sa mise
    4 - Enregistré l'addresse et la value du nouvelle enchérisseur
    English
    1 - Verify that the bidder has sent more ETH than the initial and the last bidder
    2 - Check that the auction has started and is not yet finished
    3 - Refound previous bidder
    4 - Save address and value from new bidder
     */
    function bidding(uint256 _listingId) payable external {
        require(msg.value>_lists[_listingId].minBid&&msg.value>_lists[_listingId].lastBidder.bid,"Not enought money");
        require(_lists[_listingId].startDate!=0&&block.timestamp>_lists[_listingId].startDate,"Auction not started");
        require(block.timestamp<(_lists[_listingId].startDate+_lists[_listingId].timeAuction),"Auction finished");
        //refunded previous bidder
        payable(_lists[_listingId].lastBidder.addressBidder).transfer(_lists[_listingId].lastBidder.bid);
        _lists[_listingId].lastBidder = Bidder(msg.sender,msg.value);
        Logger(addressLoger)._Bidders(address(this),msg.sender,msg.value,_listingId);
    }

    /**
    French
    1 - On vérifie bien que la liste n'est pas fini et que c'est une enchère
    2 - Si c'est un lazy mint on vérifie que les tokens ne sont pas déja créer puis on lazy mint ces tokens
    3 - Si c'est un batch mint on vérifie que tous les tokens appartiennent encore a l'addressminter puis on les transfer
    4 - Ensuite en cas d'echec on rembourse le gagnant, et en cas de réussite on envoi les fonds vers les bénificaires
    5 - Et ont détruit la list du tableau des lists pour gagner en optimisation
    English
    1 - We check that the list is not finished and that it is an auction
    2 - If it is a lazy mint we check that the tokens are not already created then we lazy mint these tokens
    3 - If it is a batch mint we check that all the tokens still belong to the addressminter then we transfer them
    4 - Then in case of failure, the winner is reimbursed, and in case of success, the funds are sent to the beneficiaries
    5 - And destroyed the list of the list table to gain optimization
     */
    function endAuction(uint256 _listingId) external onlyOwner {
        require(block.timestamp>=(_lists[_listingId].startDate+_lists[_listingId].timeAuction),"List not finished");
        require(_lists[_listingId].direct == false,"Not an auction");
        bool tokenNotValid;
        INERC721A contractToken = INERC721A(_lists[_listingId].addressContractToken);
        if( contractToken.getLazyMint()==false){
            for (uint256 index = 0; index < _lists[_listingId]._tokenInAuction.length; index= unsafe_inc(index)) {
                if(_lists[_listingId].addressMinter != contractToken.ownerOf(_lists[_listingId]._tokenInAuction[index])) tokenNotValid = true;
            }
            if(tokenNotValid==false) transferListingTokens(_lists[_listingId].addressMinter,_lists[_listingId].lastBidder.addressBidder,_lists[_listingId]);
        }else{
            for (uint256 index = 0; index < _lists[_listingId]._tokenInAuction.length; index= unsafe_inc(index)) {
                if(contractToken.exists(_lists[_listingId]._tokenInAuction[index]) == true) tokenNotValid = true;
            }
            if(tokenNotValid==false){
                for (uint256 index = 0; index < _lists[_listingId]._tokenInAuction.length; index= unsafe_inc(index)) {
                    contractToken.lazyMint(1,msg.sender,_lists[_listingId]._tokenInAuction[index]);
                }
            }
            
        }
        if(tokenNotValid==true){
            //Logger(addressLoger).Errors(_listingId,msg.sender, _lists[_listingId],"Token not exist on this address");
            payable(_lists[_listingId].lastBidder.addressBidder).transfer(_lists[_listingId].lastBidder.bid);
        }else{
            Logger(addressLoger)._Lists(address(this),_listingId,msg.sender, _lists[_listingId],"Ended");
            payRoyalties(_listingId,_lists[_listingId].lastBidder.bid);
        }
        deleteList(_listingId);
    }

    /**
    French
    1 - Boucle sur les adresses des bénéficiaires
    2 - Calcul la valeur que l'ont va donné a chaque bénificiaire par rapport aux prix du last bidder et le % que le bénificaires doit récupéré
    3 - Envoi les fonds vers l'addresse du bénificiaire si sont address n'est pas égal a 0
    English
    1 - Loop on beneficiary addresses
    2 - Calculate the value that will be given to each beneficiary in relation to the prices of the last bidder and the % that the beneficiary must recover
    3 - Sends the funds to the beneficiary's address if the address is not equal to 0
    */
    function payRoyalties(uint256 _listingId, uint256 amount) internal {
        for (uint8 iRoyalties = 0; iRoyalties < _lists[_listingId]._royaltiesAddr.length; iRoyalties++) {
            uint256 pay = amount*(_lists[_listingId]._royaltiesPercent[iRoyalties]/100);
            if(_lists[_listingId]._royaltiesAddr[iRoyalties] != address(0)){
                payable(_lists[_listingId]._royaltiesAddr[iRoyalties]).transfer(pay);
                Logger(addressLoger)._Paiement(address(this),_listingId,_lists[_listingId]._royaltiesAddr[iRoyalties],pay);
            }
        }
    }

